      content:
        "When I was theorizing about this entire trip months ago, India was one of the key countries that glued it all together. If you had asked me last year if I felt confident traveling to India solo, it would have been an easy â€œabsolutely notâ€. It wasnâ€™t until I was being ripped down the highway in Bangkok on the back of a GrabBike with a broken speedometer with no helmet on that I thought â€œYeah you know whatâ€¦maybe I should just go for a huge ass world trip to India after thisâ€ and I now here I am!\nI came for the chaos of everything (along with the sites + food of course) and got exactly what I wanted. So much so that it made me want even more! I met a few friends over the last year who gushed about how much they loved India and now after experiencing just a snippet for myself, I can already understand what they mean. \nMy biggest takeaway from India is how nice everyone is! Restaurant owners wonâ€™t be afraid to have a full-on conversation with you. Strangers wonâ€™t hesitate to help you get to your next location safely. Local tourists wonâ€™t be scared to ask where youâ€™re from and grab a selfie. Even the eager tuk-tuk drivers, shopkeepers, and guides trying to sell themselves are very kind! Always a smile on their face even after you nicely tell them â€œno thank youâ€ for the 20th time ğŸ˜… Itâ€™s a special experience that I think everyone should go to see for themselves ğŸ˜‰\nMy time here unfortunately was cut short due to a typhoon in Hong Kong but despite the setback, I made the most of the time I had. I eagerly await the day when I have the opportunity to visit India again. Hopefully for much longer.\nà¤§à¤¨à¥à¤¯à¤µà¤¾à¤¦ India!!",
