      title: "Beijing | Xi'an | Zhangjiajie, Chinaâ€ˆğŸ‡¨ğŸ‡³",
      content:
        "I never imagined myself visiting China in my lifetime. It wasn't until I met Yao, my old college roommate, study buddy, teammate, and one of my best friends that I felt a desire to go see it for myself. I feel like I always had this made-up scenario where one day he would be visiting his home in Beijing, I would visit China, and he would be able to give me a personal tour. Realizing how absurd that scenario was after visiting him in London last year, I had a hunch that wasnâ€™t going to happen. I needed to make moves on my own.\nAfter months of preparation, I was finally able to visit China! China was the only country where I had no option to obtain an e-visa or a visa on arrival. I had to meticulously plan out my entire trip, print out all the receipts, ticket stubs, and reservations, go into the consulate in San Fransisco with paperwork in hand for a visa interview, wait several hours for my name to be called, explain my reason for visiting China, give them my passport, and then pick it up weeks later. It was a confusing, stressful, and at times arduous process but it was all worth it in the end!\nThe best way to summarize China is that itâ€™s BIG. The National Park in Zhangjiajie had massive and out-of-this-world scenery with an incredible infrastructure to boot! The crowds inside the main dig site for the Terracotta Warriors in Xiâ€™an were busier than Disneyland on a holiday. The Great Wall was so large you could see it far into the horizon without effort. Beijing was a gigantic mega city such that even with a highly optimized public transportation network, it still takes you an hour to get from one tourist site to the next. It was wonderful to experience the absurdity of scale here. It was really like nowhere I had been before.\nI made a lot of wonderful memories during my stay here. Iâ€™m going to cherish the fun experiences I had with my new friends. I'm going to miss the spectacular and cheap Chinese food. I'm going to wonder what I did to deserve the above-and-beyond hospitality I was provided during my stay here. Iâ€™m going to continually think back on how happy strangers were to see a foreigner smile back and simply say â€˜helloâ€™ to them in their native language. Finally, Iâ€™m going to say a big è°¢è°¢ to China for allowing foreigners to come and experience the marvels of this country once again â˜ºï¸",
